--[[
                ----- Sida's Auto Carry -----

    Note: The menu locations in the guide below are now wrong with version r90 and above, but the features still remain.

    =========================================
                  How To Install
    =========================================

        1. Download BoL (https://mega.co.nz/#F!vYsS3L4A!9ztiQsX6TzaCA7-IUUTk-g)
        2. Extract BoL folder somewhere
        3. Go to BoL/Scripts folder and save this file as "Sida's Auto Carry.lua", make sure it is a lua file!
        4. Run BoL Studio.exe, click Custom Scripts and enable "Sida's Auto Carry"
        5. Load game and enjoy.

    =========================================
                      Intro
    =========================================

        Thank you for donating for Sida's Auto Carry: Reborn

        Reborn is an all-round orbwalk script packed with tons of features such as skills, farming, jungle clearing, plugins and much more.

            Orbwalking: Each auto attack has a Wind-Up animation which is the animation your champion will do to perform the attack.
                        There is a "sweet spot" whereby you can cancel this wind-up animation early but still fire your attack. This allows
                        you to start moving again earlier than you would have done.

                        The process of Attack -> Animation Cancel -> Move is known as Orbwalking.

    =========================================
                  Basic Guide
    =========================================

        Reborn has 4 main modes:
            Auto Carry
            Mixed Mode
            Last Hit
            Lane Clear

        Auto Carry: This mode is your primary mode for attacking enemies. This is what you should use in fights.

        Mixed Mode: This mode is a hybrid between farming and attacking enemies. It will last hit while also attacking enemies that
                    come into range. Great for the laning phases.

        Last Hit: This is a pure last hit mode that will ignore enemies completely.

        Lane Clear: This mode is designed for pushing the lane. It will attack enemies in range, last hit, and also constantly attack
                    minions to push the lane. It will also attack other objects such as Zyra's plants and Heimerdinger's turrets and jungle minions.

    =========================================
                 Hidden Features
    =========================================

        Jungling: Hold the Lane Clear key around jungle camps to orbwalk them. Reborn will prioritise the larger monsters first, only switching
                    if a smaller one can be killed with 1 attack.

        Towers, Inhibitors and Nexus: Reborn can also orbwalk towers, inhibitors and the nexus. You have two options for this:

                    Lane Clear: Select the tower with left click and then hold the lane clear key. This will orbwalk the tower while securing last hits.
                    Auto Carry: Select the tower with left click and then hold the Auto Carry key. This will orbwalk the tower and ignore last hits.

        Ward Killing: Hold the Lane Clear key around enemy wards to attack them

    =========================================
                  Hints & Tips
    =========================================

        Lane Clearing:

            When using Lane Clear, try to keep as many enemy minions inside your attack range as possible. This will allow Reborn to make the
            best calculations possible.

        Tower Farming:

            When farming under towers try to stand as close as possible to the minion that the tower is attacking. You will need less time
            for your attack to reach the minion and will greatly improve performance of farming under towers.

        General Farming:

            Disable "Auto Attack" in your League of Legends settings to improve farming performance.


    =========================================
                  Settings Guide
    =========================================

    --------- Changing Hotkeys ------------

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Setup"
            3. Here you will find 4 modes, select the one you would like to change the key for
            4. Look for the setting "Hotkey"
            5. Click the letter next to Hotkey and press the keyboard key you would like to use

    --------- Focus Selected Target ------------

        This feature will allow you to force reborn to attack a target by left clicking it.
        There are three options for this mode:

            1. None - Feature disabled
            2. When In Range - If your selected target is in range and can be attacked then you will
                attack it, otherwise find a new target.
            3. Absolute Target Lock - When using this mode, selecting an enemy will force Reborn to
                completely lock on to it. You will only attack that target until either you
                deselect it or they die. You will not attack other enemies, minions, towers etc
                even if your target is out of range or vision.

    --------- Items ------------

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Setup"
            3. Select the mode you wish to configure
            4. You can turn items on/off for each mode from here

    --------- Enable/Disable movement and attacks ------------

        You can disable moving or attacking in any of the modes.

            1. Open the in-game menu (default key Shift)
            2. Select "Sida's Auto Carry: Setup"
            3. Select the mode you wish to configure
            4. You can enable/disable movement and attacking at the bottom of the list

    --------- Circle Drawing ------------

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Select "Drawing"
            4. In here you can enable/disable range circle indicators and switch between high-quality/low-fps circles

    --------- Enemy Range Circles ------------

        Reborn can display the range of enemy auto attack circles.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Select "Enemy Range Circles"
            4. You can choose to draw circles based on role (ADC, Tank etc) or per champion for your current game

    --------- Minion Drawing ------------

        Reborn will split minion health bars into sections to show you how much damage your auto attacks will do.
        It will also draw arrows to show you when to last hit.
        These features may cause FPS drops.

        Orange Arrow: -> Lane Clear is waiting for a moment to secure the last hit
        White Arrow: -> Minion is killable!

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Select "Minion Drawing"
            4. Here you can choose how many minion health bars to modify and whether to show last hit arrows.

    --------- Melee Configuration ------------

        For melee champions you can choose to either fully orbwalk or to "stick" to your target
        when you are within a close range to avoid running through them.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Select "Melee Config"
            4. Choose your "sticky range" here

    --------- Advanced Options ------------

        Everyone's computer behaves differently. Sometimes you might have to tweak the core functionality of Rebornn
        to suit your computer.

        These settings are saved [per champion] to allow you to customise it for each champion you play.

        Last Hit Adjustment -> This setting will make you last hit earlier or later in case you are having issues
        Animation Cancel Adjustment -> This setting will make you cancel your attack animation earlier or later.
                                        If you find your attacks are getting cancelled, set this to attack laster to fix the issue.
                                        If not, you may be able to even set this to cancel earlier for faster orbwalking!

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Select "Advanced"
            4. Here you can set the amounts for the adjustments as whether they should be earlier or later.

    --------- Support Mode ------------

        Support mode will disable auto attacks in all modes, allowing you to still use the other features
        of reborn for support characters as well as plugins.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Enable Support Mode

    --------- Disable Toggle Mode On Right Click ------------

        If you are using toggle modes (press once to activate press again to deactivate), this will allow you to manually
        resume control of your champion again when you right click to move.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Enable it here

    --------- Mouse Over Hero To Stop Move ------------

        This feature will cause your character to stop moving when you hover your mouse over it, but continue to last hit or
        perform the features of the current mode you're using.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Configuration"
            3. Enable it here

    --------- Skills ------------

        Reborn supports a ton of skills by default. Every skill has the option to be used for:
            Auto Carry Mode
            Mixed Mode
            Lane Clear Mode
            Killsteal
            Lane Clear Farming

        Please remember that you must use your brain to select which to use for farm, killsteal etc. Don't turn on Annie's Tibbers for farming.
        You can also set a hotkey to enable/disable skill farm and a minimum mana amount for skill farming.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Skills"
            3. Select the skill you wish to use
            4. Choose the modes you wish to use this skill in

    --------- Masteries ------------

        Reborn will use your masteries to assist with farming. You must set these manually for each champion once.
        If you forget to set your masteries it's better to turn them off rather than leave the wrong ones on!

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Farming"
            3. Select "Masteries"

    --------- Damage Prediction Settings ------------

        Reborn will look at all incoming damage on to enemy minions and try to calculate the best time to last hit, as well as when it
        should wait for a moment to secure the last hit. If you are finding it's not waiting at the right time there are 3 methods
        of calculation you can try. One of the others may work better for you.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Farming"
            3. Select "Damage Prediction Settings"
            4. You may change the "Lane Clear Method" from default to one of the others if you wish to try them

    --------- Lane Freeze ------------

        Lane Freeze will allow you to farm while freezing the lane by attacking at the last moment instead of as soon as you can get the last hit.
        For example if you have full AD items and use normal last hit, you cann last hit minions at almost full HP and will push the lane fast.
        Lane Freeze will wait until the last moment even if you have full AD items.

        The default hotkey for Lane Freeze is F1.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Farming"
            3. You can enable Lane Freeze here or change the hotkey by clicking on the number (default 112) in the menu.

    --------- Stream Mode ------------

        Stream Mode will attempt to make it less obvious you're using a bot.
        It will clear your chat of all BoL messages when it loads and hide any drawing from the bot.
        You can also choose to enable "fake clicks" that make it look like you are actually right clicking when you move.
        "Smart" mode will use red clicks when you are attacking and green clicks when you are moving.
        You can also choose to always show click markers, not only in stream mode.

            1. Open the in-game menu (default key SHIFT)
            2. Select "Sida's Auto Carry: Streaming"

